import React, { useState, useEffect } from "react";

const PictureGenerator = () => {
  const [pictures, setpictures] = useState([
    {
      name:
        "data:image/jpeg;base64,",
      id: 1
    },
    {
      name:
        "data:image/jpeg;base64,",
      id: 2
    },
    {
      name:
        "data:image/jpeg;base64,",
      id: 3
    }
  ]);
  const [num, setnum] = useState(1);
  console.log(pictures.length);
  const onchangeleft = () => {
    let n = num - 1;
    if (n < 0) {
      n = pictures.length - 1;
      setnum(n);
    } else {
      setnum(n);
    }
  };

  const onchangeright = () => {
    let n = num + 1;
    if (n >= pictures.length) {
      n = 0;
      setnum(n);
    } else {
      setnum(n);
    }
  };
  return (
    <div>
      <img src={pictures[num].name} />
      <div>
        <button onClick={onchangeleft}>Left</button>
        <button onClick={onchangeright}>right</button>
      </div>
    </div>
  );
};

export default PictureGenerator;
